from collections import Counter
from typing import List

class Solution:
    def canReorderDoubled(self, arr: List[int]) -> bool:
        cntr = Counter(arr)
        pos, neg, zeros = list(), list(), list()
        for n in arr:
            if n > 0:
                pos.append(n)
            elif n < 0:
                neg.append(n)
            else:
                zeros.append(n)
        if len(zeros) % 2 != 0:
            return False
        pos.sort()
        neg.sort(reverse=True)
        for n in neg:
            if cntr[n] > 0:
                cntr[n] -= 1
                if 2*n not in cntr or cntr[2*n] == 0:
                    return False
                cntr[2*n] -= 1
        for n in pos:
            if cntr[n] > 0:
                cntr[n] -= 1
                if 2*n not in cntr or cntr[2*n] == 0:
                    return False
                cntr[2*n] -= 1
        return True

